import config from '../../assets/icons/MenuItemIcons/config.svg';
import Menu from '../shared/Menu/Menu';
import Dropdown from '../Dropdown/Dropdown';

const ListItems = [
    {
        title: 'Settings',
        icon: config,
    },
    {
        title: 'Log out',
        icon: logOut,
    },
];

const Header = props => {
    const [show, setShow] = useState(true);
    return (
        <div className='bg-white w-full fixed flex flex-row-reverse pl-72 pr-10 py-8'>
            <div className='flex flex-col items-end'>
                <Dropdown />
            </div>
        </div>
    );
};

Header.propTypes = {};

export default Header;
